      out.write("	<script type=\"text/javascript\">\r\n");
      out.write("		$(function() {\r\n");
      out.write("			$('.slideshow').each(function() {\r\n");
      out.write("				// each : 앞에 선택된 내용의 개수만큼 반복하도록 하는 메서드\r\n");
      out.write("				let $slides = $(this).find(\"img\");\r\n");
      out.write("				let slideCount = $slides.length;\r\n");
      out.write("				let currentIndex = 0;\r\n");
      out.write("				$slides.eq(currentIndex).fadeIn();\r\n");
      out.write("				// 첫 이미지를 나타나게 함\r\n");
      out.write("\r\n");
      out.write("				// 다음이미지가 나타나게 끔->현재 이미지를 페이드아웃하고 다음이미지를 나타나게 하고 현재이미지값으로 변경시켜서 로테이션돌게 함\r\n");
      out.write("				let showNextSlide = function() {\r\n");
      out.write("					let nextIndex = (currentIndex + 1) % slideCount;\r\n");
      out.write("					// 다음이미지의 인덱스 값을 구하는데 이미지가 4개이므로 최대값이 3이되어야 함 따라서 나머지 연산자를 통해 반복하도록 함(1~4의 값을 4로 나누므로 0~3을 반복시킴-어차피 0은 위에서 표시되도록 했으니까.....?)\r\n");
      out.write("					$slides.eq(currentIndex).fadeOut();\r\n");
      out.write("					// 현재 이미지를 사라지게 하고\r\n");
      out.write("					$slides.eq(nextIndex).fadeIn();\r\n");
      out.write("					// 위에서 구한 다음 이미지를 나타나게 함\r\n");
      out.write("					currentIndex = nextIndex;\r\n");
      out.write("					// 다음 이미지의 값을 현재로 \r\n");
      out.write("				}\r\n");
      out.write("\r\n");
      out.write("				let timer = setInterval(showNextSlide, 5000);\r\n");
      out.write("				$(this).on('mouseover', function() {\r\n");
      out.write("					//타이머 취소\r\n");
      out.write("					clearInterval(timer);\r\n");
      out.write("				}).on('mouseout', function() {\r\n");
      out.write("					//타이머 시작\r\n");
      out.write("					timer = setInterval(showNextSlide, 5000);\r\n");
      out.write("				})\r\n");
      out.write("			})\r\n");
      out.write("		});\r\n");
